import React, {useState} from 'react';

import '../App.css';
import  './Home.css';
import { Button } from '../components/Button';
import { ReactComponent as Logo } from '../assets/theMet.svg';

function Home() {
  const button = useState(true)
  return (
    <>
      <main className='hero-container'>
        <div className='headings'>
          <Logo className='main-logo'></Logo>
          <h1>Discover Art Like Never Before</h1>
          <div className="cta-buttons">
            {button && (<Button buttonStyle='btn--nav' >Sign Up</Button>)}
            <button className="btn btn--primary" to='/tour'>Start Exploring</button>
            <button className="btn btn--outline" to='/education'>Learn More</button>
          </div>
        </div>
      </main>
    </>
  );
}

export default Home;
